create table cars
(
    id          integer not null
        primary key,
    make_id     text,
    model       text,
    year        integer,
    vin         text,
    color       text,
    price       double precision,
    city        text,
    state       text,
    postal      integer,
    longitude   double precision,
    latitude    double precision,
    description text,
    seller      text,
    seller_name text,
    image       text,
    image_thumb text
);

alter table cars
    owner to postgres;

